INSERT INTO `hris_job_posting_tbl` VALUES (1,1,'PRF-21-00000','Front end developers are computer programmers who specialize in website design. Front end developer duties include determining the structure and design of web pages, striking a balance between functional and aesthetic design, and ensuring web design is optimized for smartphones.','\nHealth insurance\nDisability insurance\nDental and vision insurance\nLife insurance\nPTO/paid holidays\nRetirement planning\nFamily leave\nRemote work or flexible schedules\nStudent loan repayment\nContinued education and professional development',1,1,'2021-12-28 00:58:28','2021-12-28 00:58:28','2021-12-28 01:00:07',2,2),(2,2,'PRF-21-00002','The responsibilities of senior developers include writing code, analyzing data, and contributing to the design and implementation of software. ... Ultimately, a top-notch senior developer should have extensive experience in software development, be able to keep up-to-date with deadlines, and have strong analytical skills.','Health insurance\nDisability insurance\nDental and vision insurance\nLife insurance\nPTO/paid holidays\nRetirement planning\nFamily leave\nRemote work or flexible schedules\nStudent loan repayment\nContinued education and professional development',1,1,'2021-12-28 04:55:55','2021-12-28 04:55:55','2021-12-28 04:57:45',2,2),(3,3,'PRF-21-00003','This UI-UX Designer job description template includes the list of most important UI-UX designer\'s duties and responsibilities. This UI-UX Designer job description template is customizable and ready to post to job boards.','Health insurance\nDisability insurance\nDental and vision insurance\nLife insurance\nPTO/paid holidays\nRetirement planning\nFamily leave\nRemote work or flexible schedules\nStudent loan repayment\nContinued education and professional development',1,2,'2022-01-03 05:08:48','2022-01-03 05:08:48','2022-01-03 05:25:24',2,2),(4,4,'PRF-22-00004','As a Junior Software Developer, you will be responsible for supporting our software development team in all aspects of the development, testing and implementation of our product.','Health insurance\nDisability insurance\nDental and vision insurance\nLife insurance\nPTO/paid holidays\nRetirement planning\nFamily leave\nRemote work or flexible schedules\nStudent loan repayment\nContinued education and professional development',1,1,'2022-01-03 07:22:25','2022-01-03 07:22:25','2022-01-03 07:23:25',2,2),(5,5,'PRF-22-00005','Creating user-centered designs by understanding business requirements, and user feedback\n\nCreating user flows, wireframes, prototypes and mockups\n\nTranslating requirements into style guides, design systems, design patterns and attractive user interfaces\n\nDesigning UI elements such as input controls, navigational components and informational components\n\nCreating original graphic designs (e.g. images, sketches and tables)\n\nIdentifying and troubleshooting UX problems (e.g. responsiveness)\n','Health insurance\nDisability insurance\nDental and vision insurance\nLife insurance\nPTO/paid holidays\nRetirement planning\nFamily leave\nRemote work or flexible schedules\nStudent loan repayment\nContinued education and professional development',1,1,'2022-01-05 03:46:21','2022-01-05 03:46:21','2022-01-05 03:49:05',2,2),(6,6,'PRF-22-00006','IT administrators oversee organizations\' computer systems and manage IT teams. They maintain information systems and networks, upgrade and install new hardware and software, and perform troubleshooting. They also back up data and manage network security.','\nHealth insurance\nDisability insurance\nDental and vision insurance\nLife insurance\nPTO/paid holidays\nRetirement planning\nFamily leave\nRemote work or flexible schedules\nStudent loan repayment\nContinued education and professional development',1,1,'2022-01-06 05:34:38','2022-01-06 05:34:38','2022-01-06 05:36:33',1,1),(7,7,'PRF-22-00000','sample description','sample benefits',1,1,'2022-01-27 06:51:28','2022-01-27 06:51:28','2022-0