INSERT INTO `pms_personnel_requisition_tbl` VALUES (1,NULL,2,'2',NULL,1,3,14,20000.00,2,0,0,1,0,'null','null','Front End Developers must have a bachelor’s degree in computer science, computer engineering or a related field. Candidates must demonstrate proficiency in programming languages such as HTML, C#, JavaScript and SQL. Front End Developers should also have a thorough understanding of web design and SEO optimization. Most employers prefer applicants who have trained in cross-platform website design and keep themselves up to date on new website tools and languages as they enter the workforce.','Determining the structure and design of web pages.\nEnsuring user experience determines design choices.\nDeveloping features to enhance the user experience.\nStriking a balance between functional and aesthetic design.\nEnsuring web design is optimized for smartphones.','Need additional personnel for the operation department','2021-12-28','2','2','2021-12-28 08:58:27','2021-12-28 08:58:27.0',2,2,'2021-12-28 08:58:27','2021-12-28 00:58:28'),(2,NULL,2,'2',NULL,1,3,5,30000.00,2,0,0,1,0,'null','null','Degree in information technology, computer science, or related.\nExtensive knowledge of software development and its technologies.\nStrong knowledge of Javascript, C++, PHP, and SQL.\nSolid experience in coding.\nStrong knowledge of user interfaces.\nStrong knowledge of HTML and web frameworks.\n5 years working experience','Performing coding assignments.\nReviewing code work for accuracy and functionality.\nCreating and implementing design plans.\nAnalyzing code segments regularly.\nDelegating tasks to team members.\nKeeping up-to-date with industry trends and technology developments.','Need additional personnel','2021-12-30','4','2','2021-12-28 12:55:53','2021-12-28 12:54:44.0',2,4,'2021-12-28 12:54:44','2021-12-28 04:55:55'),(3,NULL,2,'5',NULL,1,3,12,20000.00,2,0,0,1,0,'null','null','You have a degree/diploma in Design, Fine Arts, Engineering or related field\nYou have prior experience as a UI/UX Designer as well as a strong portfolio of related projects\nYou are proficient in Adobe Creative Suite (specifically Illustrator, InDesign and Photoshop)\nYou are proficient in prototyping tools such as Sketch, InVision, etc.\nBasic HTML5, CSS3, and JavaScript skills are a plus\nYou pay strong attention to detail and have a keen eye for aesthetics\nYou have excellent communication skills and can clearly articulate your ideas, designs, and suggestions\nYou are a strong team player who can collaborate effectively with different stakeholders','Creating user-centered designs by understanding business requirements, and user feedback\nCreating user flows, wireframes, prototypes and mockups\nTranslating requirements into style guides, design systems, design patterns and attractive user interfaces\nDesigning UI elements such as input controls, navigational components and informational components\nCreating original graphic designs (e.g. images, sketches and tables)\nIdentifying and troubleshooting UX problems (e.g. responsiveness)\nCollaborating effectively with product, engineering, and management teams\nIncorporating customer feedback, usage metrics, and usability findings into design in order to enhance user experience','For requisition of personnel','2022-01-20','4','2','2022-01-03 13:08:46','2022-01-03 13:03:19.0',2,2,'2021-12-28 15:18:16','2022-01-03 05:25:24'),(4,NULL,2,'2',NULL,1,3,15,23000.00,2,0,0,1,0,'null','null','Analytical and problem-solving skills. \nAbility to work as a team player.\nCompetence. \nAbility to learn. .\nTime management. .\nCommunication skills.','Assisting the development manager with all aspects of software design and coding.\nAttending and contributing to company development meetings.\nLearning the codebase and improving your coding skills.\nWriting and maintaining code.\nWorking on minor bug fixes.\nMonitoring the technical performance of internal systems.\nResponding to requests from the development team.\nGathering information from consumers about program functionality.\nWriting reports.\nConducting development tests.','Requisition of personnel','2022-01-27','4','2','2022-01-03 15:22:23','2022-01-03 15:21:48.0',2,4,'2022-01-03 15:21:48','2022-01-03 07:22:25'),(5,NULL,2,'2',NULL,1,3,12,10000.00,2,0,0,2,0,'null','null','2 years of experience as an UI-UX Designer or similar role.\nUI design portfolio.\nBachelor\'s degree in relevant field.\nExcellent interpersonal and communication skills.\nAbility to discuss and explain design options.\nDetail oriented.','Creating user-centered designs by understanding business requirements, and user feedback.\nCreating user flows, wireframes, prototypes and mockups.\nTranslating requirements into style guides, design systems, design patterns and attractive user interface','Need another personnel','2022-01-27','4','2','2022-01-05 11:46:18','2022-01-05 11:45:33.0',2,4,'2022-01-05 11:45:33','2022-01-05 03:46:21'),(6,NULL,1,'2',NULL,1,4,8,15000.00,1,0,0,1,0,'null','null','Bachelor\'s degree in computer science, information technology, information systems, or similar.\r\nApplicable professional qualification, such as Microsoft, Oracle, or Cisco certification.\r\nAt least two years\' experience in a similar role.\r\nExtensive experience with IT systems, networks, and related technologies.\r\nSolid knowledge of best practices in IT administration and system security.\r\nExceptional leadership, organizational, and time management skills.\r\nStrong analytical and problem-solving skills.\r\nExcellent interpersonal and communication skills.','Monitoring and maintaining networks and servers.\r\nUpgrading, installing and configuring new hardware and software to meet company objectives.\r\nImplementing security protocols and procedures to prevent potential threats.\r\nCreating user accounts and performing access control.\r\nPerforming diagnostic tests and debugging procedures to optimize computer systems.\r\nDocumenting processes, as well as backing up and archiving data.\r\nDeveloping data retrieval and recovery procedures.\r\nDesigning and implementing efficient end-user feedback and error reporting systems.\r\nSupervising and mentoring IT department employees, as well as providing IT support.\r\nKeeping up to date with advancements and best practices in IT administration.','Requisition of personnel','2022-01-06','2','2','2022-01-06 13:34:36','2022-01-06 13:33:30.0',1,2,'2022-01-06 13:33:30','2022-01-06 05:34:38'),(7,NULL,20,'2',NULL,1,3,9,18000.00,2,1,0,1,0,'null','null','technical knowledge about testing','testing the system','lacks manpower','2022-02-21','20','2','2022-01-27 14:51:15','2022-01-27 14:51:15.0',20,20,'2022-01-27 14:51:15','2022-01-27 06:51:28'),(8,NULL,1,'1',NULL,10,4,1,16000.00,1,1,0,1,0,'null','null','test','test','PRF-22-00008 - this should not create new document','2022-02-23','2',NULL,NULL,'2022-02-09 05:21:04.0',1,1,'2022-02-09 04:51:46','2022-02-09 05:21:06'),(9,8,1,'4',NULL,10,4,1,16000.00,1,1,0,1,0,'null','null','test\r\ntest','test','test','2022-02-17','2',NULL,NULL,'2022-02-09 04:57:57.0',1,1,'2022-02-09 04:57:57','2022-02-09 05:01:50'),(10,8,1,'4',NULL,10,4,1,16000.00,1,1,0,1,0,'null','null','test','test','it should not create new document.','2022-03-08','2',NULL,NULL,'2022-02-09 05:04:02.0',1,1,'2022-02-09 05:04:02','2022-02-09 05:04:12'),(11,8,1,'4',NULL,10,4,1,16000.00,1,1,0,1,0,'null','null','test','test','it should not create new document','2022-02-23','2',NULL,NULL,'2022-02-09 05:04:38.0',1,1,'2022-02-09 05:04:38','2022-02-09 05:07:34'),(12,8,1,'4',NULL,10,4,1,16000.00,1,1,0,1,0,'null','null','test','test','test --','2022-03-10','2',NULL,NULL,'2022-02-09 05:10:27.0',1,1,'2022-02-09 05:10:27','2022-02-09 05:10:36');
